import React from "react";
import { useNavigate } from "react-router-dom";
import "./Faq.css";

const InfoContainer = () => {
  const navigate = useNavigate();

  return (
    <div className="info-main">
      <h1 className="info-title">Help & Support</h1>

      {/* Row 1: Buying + Selling */}
      <div className="info-row">
        <div className="info-box">
          <button onClick={() => navigate("/buying")}>Buying</button>
        </div>
        <div className="info-box">
          <button onClick={() => navigate("/selling")}>Selling</button>
        </div>
      </div>

      {/* Row 2: Account + Safety & Policy */}
      <div className="info-row">
        <div className="info-box">
          <button onClick={() => navigate("/account")}>Account</button>
        </div>
        <div className="info-box">
          <button onClick={() => navigate("/safety-policy")}>Safety & Policy</button>
        </div>
      </div>
    </div>
  );
};

export default InfoContainer;
